import React from 'react';
import {Drop,DropTitle,Span,Form,FormInput, InputEmail, InputText,InputExp,TextArea,InputSubmit } from './style';


function Contect (){
	
		return (
			
			<Drop>
            <div className="container">
                <DropTitle><Span>Drop </Span>Me A line</DropTitle>
                <Form action="">
                    <FormInput>
                        <InputText type="text" placeholder="Your Name"/>
                        <InputEmail type="email" placeholder="Your Email"/>
                    </FormInput>
                    <InputExp type="text"  placeholder="Your Subject"/>
                    <TextArea cols="30" rows="10" placeholder="Your Message"/>
                    <Submit type="submit" value="Send Message"/>
                </Form>
            </div>
        </Drop>		
		);
	}

export default Contect;
